package guviPortalTaskOne;

public class printNumberBtw {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		// Write a program to print the numbers between 10 to 50 using for loop/ while loop
		
		int index = 10;
		int End = 50;
		while(index <= End) {
			System.out.println(index);
			index++;
		}
	}

}
